import "./profile.scss"
import FacebookIcon from '@mui/icons-material/Facebook';
import TwitterIcon from '@mui/icons-material/Twitter';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import EmailIcon from '@mui/icons-material/Email';
import PlaceIcon from '@mui/icons-material/Place';
import LanguageIcon from '@mui/icons-material/Language';
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';
import Posts from "../../components/posts/Posts";
import { useContext, useState } from "react";
import {
    useQuery, useMutation, useQueryClient
} from '@tanstack/react-query'
import { useLocation } from "react-router-dom";
import { makeRequest } from "../../axios";

const Profile = () => {
    const userId = useLocation().pathname.split("/")[2]

    const { isLoading, error, data } = useQuery(['user'],
        () =>
            makeRequest.get(`/users/find/${userId}`).then((res) => {
                return res.data;
            })
    )

    return (
        <div className='profile'>
            <div className="images">
                <img src="https://images.pexels.com/photos/14661921/pexels-photo-14661921.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2" alt="" className="cover" />
                <img src="https://images.pexels.com/photos/14661921/pexels-photo-14661921.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2" alt="" className="profile" />
            </div>
            <div className="profileContainer">
                <div className="uinfo">
                    <div className="left">
                        <a href="http://facebook.com">
                            <FacebookIcon fontSize="large" />
                        </a>
                        <a href="http://facebook.com">
                            <TwitterIcon fontSize="large" />
                        </a>
                        <a href="http://facebook.com">
                            <LinkedInIcon fontSize="large" />
                        </a>
                        <a href="http://facebook.com">
                            <EmailIcon fontSize="large" />
                        </a>
                    </div>
                    <div className="center">
                        <span>Raebo</span>
                        <div className="info">
                            <div className="item">
                                <PlaceIcon />
                                <span>USA</span>
                            </div>
                            <div className="item">
                                <LanguageIcon />
                                <span>social.dev</span>
                            </div>
                        </div>
                        <button>follow</button>

                    </div>

                    <div className="right">
                        <EmailIcon />
                        <MoreHorizIcon />

                    </div>
                </div>
                <Posts />
            </div>

        </div>


    )
}

export default Profile
